import Navbar from "react-bootstrap/Navbar";
import {Nav} from "react-bootstrap";

export default function Sidebar(){
    return (
        <div className="border-end bg-whit h-100" id="sidebar-wrapper">

            <div className="list-group list-group-flush w-25">
                <Nav>
                <Nav.Link className="list-group-item list-group-item-action list-group-item-light p-3" href="1">Explore</Nav.Link>
                <Nav.Link className="list-group-item list-group-item-action list-group-item-light p-3" href="2">Profile</Nav.Link>
                <Nav.Link className="list-group-item list-group-item-action list-group-item-light p-3" href="3">Friend</Nav.Link>
                </Nav>
            </div>
        </div>
    );
};
